<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Swizo.com</title>
</head>
<style>
    body {
        height: 100vh;
        width: 100%;
    }
    
    .google {
        display: flex;
        align-items: center;
        justify-content: center;
    }
    
    .out {
        display: flex;
        align-items: center;
        justify-content: center;
    }
    
    .google img {
        position: relative;
    }
    
    #search {
        padding: 6px 150px;
        border-radius: 20px;
        margin: 20px 0px;
        box-shadow: -8px -8px rgb(157, 164, 170);
    }
    
    #search:hover {
        background-color: rgb(240, 229, 229);
    }
    
    .widgits {
        height: 62px;
        width: 94px;
        margin: 18px;
        transition: all 0.25s;
    }
    
    .widgits:hover {
        transform: translateY(5px);
        background-color: rgb(227, 231, 231);
    }
    
    .widgits1 {
        height: 61px;
        width: 94px;
        margin: 18px;
        transition: all 0.5s;
    }
    
    .widgits1:hover {
        transform: rotate(360deg);
        background-color: rgb(227, 231, 231);
    }
    
    .box {
        display: flex;
        align-items: center;
        justify-content: center;
    }
    
    .box2 {
        display: flex;
        align-items: center;
        justify-content: center;
    }
    
    .ins img {
        height: 60px;
        width: 60px;
        margin-left: 18px;
        border-radius: 50px;
    }
    
    .head {
        display: flex;
        align-items: center;
        justify-content: center;
    }
    
    .head1 {
        display: flex;
        align-items: center;
        justify-content: center;
    }
    
    .names {
        margin-left: 22px;
        margin-right: 28px;
    }
    
    .names1 {
        margin-left: 32px;
        margin-right: 28px;
    }
    
    .error {
        display: none;
    }
    
    @media screen and (max-width: 700px) and (min-width: 0px) {
        .box,
        .box2,
        .head,
        .head1 {
            display: none;
        }
        #search {
            padding: 6px 70px;
            border-radius: 20px;
            margin: 20px 0px;
            box-shadow: -8px -8px rgb(157, 164, 170);
        }
        .google img {
            width: 300px;
            height: auto;
            margin: 2px;
        }
    }
</style>
